        <input type="password" placeholder='password' className='p-2 m-2 rounded-lg'/>
        <button className='p-4 m-2 text-white bg-red-600 rounded-lg'>Sign In</button>
        <p className='text-white' onClick={clickSign}>need to netflix please sign up</p>
    </form>
    </div>

  )
}

export default Login;
